def EvalBitRange(bit_offset, num_bits):
    assert(bit_offset >= 0)
    assert(num_bits > 0)
    assert(bit_offset + num_bits <= 32)
    bit_range = (bit_offset, bit_offset+num_bits)
    mask = (1 << num_bits) - 1

    print('#' * 80)
    print('Evaluating bits [%d:%d] of the samples' % bit_range)

    for num_iterations in sorted(RECORDED_VALUES.keys()):
        lst = RECORDED_VALUES[num_iterations]
        print()
        print('JitterRandom num_iterations=%d, num_samples=%d' % (
            num_iterations, len(lst)))

        occurrences = Occurrences(
            samples=[((v >> bit_offset) & mask) for v in lst])
        occurrences.compute_stats()
        occurrences.print_summary()
        occurrences.print_chisquare()
        if num_bits < 5:
            occurrences.print_count_table()


def RecordRandom32(num_iterations, values):
    lst = RECORDED_VALUES[num_iterations]
    lst.extend(values)


def main():
    # Determine the randomness of the top-byte of the samples.
    bit_offset = 24
    num_bits = 8
    EvalBitRange(bit_offset, num_bits)


